import React from "react";
import './experience.css'

import {Container, Row, Col} from "reactstrap";

const developmentExperienceData = [
    {
        year: '2021',
        title: 'Авторский курс JavaScript',
        desc: 'JavaScript 2021 - Полное Руководство с Нуля до Профи'
    },

    {
        year: '2021',
        title: 'Авторский курс React',
        desc: 'React JS с Нуля до Профи. Полное руководство'
    },

    {
        year: '2021-2022',
        title: 'Фриланс',
        desc: 'Разработка интернет магазина на React'
    },
]

const Experience = () => {
    return (
        <section>
            <Container>
                <Row>
                    <Col lg='12' className='mb-5'>
                        <h2>Опыт разработки</h2>
                    </Col>

                    <Col lg='6'>
                        <div className="single__experience-container">

                            {
                                developmentExperienceData.map()
                            }
                            <div className="single__experience">
                                <span className='experience__icon'><i class='ri-briefcase-line'></i></span>
                                <h6>2021-2022</h6>
                                <p>Полный рабочий день или удаленная работа </p>
                                <h5>Junior Frontend разработчик</h5>
                                <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Cum dolorem harum illo
                                    incidunt numquam possimus? </p>
                            </div>
                        </div>
                    </Col>

                </Row>
            </Container>
        </section>
    )
}

export default Experience
